import React from "react";

const Table = () => {
  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Title</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>12</td>
            <td>First title</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Table;
